MLI18n::gi()->{'formfields__stocksync.frommarketplace__help'} = '
     <b>Nota</b>: {#setting:currentMarketplaceName#} sólo conoce "disponible" o "no disponible". Por lo tanto:<br>
    <br>
    <ul>
        <li>Tienda&apos;s cantidad de stock &gt; 0 = disponible en {#setting:currentMarketplaceName#}</li>
        <li>Shop&apos;s stock quantity &lt; 0 = no disponible en {#setting:currentMarketplaceName#}</li>
    </ul>
    <br>
    Función:<br>
    Sincronización automática mediante CronJob (recomendado)<br>
    <br>
    <br>
    La función "Sincronización automática por CronJob" iguala el stock actual {#setting:currentMarketplaceName#} con el stock de la tienda cada 4 horas.*<br>
    <br>
    <br>
    Mediante este procedimiento, se comprueba si se han producido cambios en los valores de la base de datos. Los nuevos datos se presentarán, incluso cuando los cambios han sido establecidos por un sistema de gestión de inventario.<br> <br>
    <br>
    Puede sincronizar manualmente los cambios de existencias, haciendo clic en el botón asignado en el magnalister-cabecera, al lado izquierdo de la ant-logo.<br>
    <br>
    Además, puede sincronizar los cambios de stock, mediante la creación de un cronjob propio a su tienda siguiente enlace:<br> <i>{#setting:sSyncInventoryUrl#}</i><br>
    <br>
    Establecer un cronjob propio está permitido para los clientes dentro del plan de servicio "Enterprise", only.<br>
    Se bloquearán las llamadas de cronjob propio que superen un cuarto de hora o las llamadas de clientes que no estén dentro del plan de servicio "Plano".<br>
    <br>
    <br>
    <br>
    <b>Nota:</b>Ajustes en "Configuración" + "Proceso de listado" ...<br> <br>
    <br>
    + "límite de pedido por día"
    + "cantidad" para las dos primeras opciones.<br><br>... se tendrán en cuenta.
